import {EditionDetails, EditionMore, EditionQueue, EditionStatus, EditionTitle} from "../styled/Dashboard.styled";

function EditionBubble(props) {
        return (
            <EditionDetails>
                <EditionTitle>{props.edition.title}</EditionTitle>
                <EditionStatus><i className="bi bi-clock-fill"></i> En cours de rédaction</EditionStatus>
                <EditionQueue>2 articles en attente, 3 en correction, 1 terminé</EditionQueue>
                <EditionMore href={""}>En voir +</EditionMore>
            </EditionDetails>
        );
}

export default EditionBubble;
